import { CHANGEID, CHANGEKEYWORD } from "./constant"

const initState = []

export default function keywordReducer(preState = initState, action) {
    const { type, data } = action
    switch (type) {
        case CHANGEKEYWORD:
            return preState[0] = data
        case CHANGEID:
            return preState[1] = data
        default:
            return preState
    }
}
